import React, { Component } from 'react';
import './Navbar.css'

class Navbar extends Component {
    render() {
        return (
            <div id="navbar">
                <p>Jenner Dulce</p>
                <div id="navbar-hyperlinks">
                    <a href="https://www.github.com/jennerdulce">About</a>
                    <a href="https://www.github.com/jennerdulce">Skills</a>
                    <a href="https://www.github.com/jennerdulce">Portfolio</a>
                    <a href="https://www.github.com/jennerdulce">Experience</a>
                    <a>Contact</a>
                </div>
            </div>
        );
    }
}

export default Navbar;
